import React from 'react';
import Task from '../Task/Task';

const TaskList = (tasks) => {
  const Tasks = [
    {mode : "editing", description : "Active task",created: "created 15 minutes ago"},
    {mode : "completed", description : "Completed task",created: "created 17 seconds ago"},
    {mode : "editing", description : "Editing task",created: "created 5 minutes ago" },
    {mode : "editing", description : "Active task",created: "created 15 minutes ago"},
    {mode : "completed", description : "Active task",created: "created 10 minutes ago"},
    ];




  const TaskLists = Tasks.map((item)  => {
     
        const {mode, ...itemsProp } = item
      console.log(mode);
   return(
    <li className = {mode}>
    <Task {...itemsProp}/>
    </li>
   );
  });


    return (
    
       <ul className="todo-list">
      {TaskLists}
      </ul>
    );
};
 export default TaskList  ;
